with open(csv_file_path, mode='r', encoding='utf-8-sig', errors='replace') as csv_file:
        reader = csv.reader(csv_file)
        for row in reader:
            team, goals, penalties = row
            if goals:
                goals = int(goals)
                if team in goals:
                    goals += int(goals[2:-1])
                else:
                    goals = 0
                if penalties:
                    penalties = int(penalties)
                    if team in penalties:
                        penalties += int(penalties[2:-1])
                    else:
                        penalties = 0
                goals = int(goals)
                penalties = int(penalties)
                goals = goals + penalties
                penalties = goals
            else:
                goals = 0
                penalties = 0
            if team in goals:
                if team in penalties:
                    goals = goals + penalties
                    penalties = 0

with open(csv_file_path, 'r') as file:
        reader = csv.reader(file)
        header = next(reader)

        for row in reader:
            team = row[0]
            goals_row = int(row[1])
            penalties_row = int(row[2])

            if team in goals:
                goals[team] += goals_row
            else:
                goals[team] = goals_row

            if team in penalties:
                penalties[team] += penalties_row
            else:
                penalties[team] = penalties_row

    return Counter(goals) + Counter(penalties)

counts = Counter()
    for key in goals:
        counts[key] += int(goals[key])
    for key in penalties:
        counts[key] += int(penalties[key])

    return counts

with open(csv_file_path, 'r') as file:
        reader = csv.reader(file)
        team_names = [row[0] for row in reader]
        for row in reader:
            for i in range(1, 3):
                team, count = row[0], int(row[i])
                if team in goals:
                    goals[team] += count
                else:
                    goals[team] = count
                if team in penalties:
                    penalties[team] += count
                else:
                    penalties[team] = count
    counts = Counter({'goals': sum(goals.values()), 'penalties': sum(penalties.values())})
    return counts

file_path = csv_file_path
    if os.path.exists(file_path):
        with open(file_path, 'r') as file:
            reader = csv.DictReader(file)
            for row in reader:
                for team in row['team'].strip().split(','):
                    goals.setdefault(team, 0)
                    penalties.setdefault(team, 0)

                    goals[team] += int(row['goals'])
                    penalties[team] += int(row['penalties'])

    return Counter(goals) + Counter(penalties)

