with open(csv_file_path, newline='') as file:
        reader = csv.reader(file)
        team = None
        for row in reader:
            if team is None:
                team = row[0]
            else:
                if row[1] == '1':
                    goals[team] += 1
                elif row[2] == '1':
                    penalties[team] += 1
                team = row[0]
    return Counter({'goals': sum(goals.values()), 'penalties': sum(penalties.values())})
